import React from "react";
import { Nav } from "@fluentui/react/lib/Nav";

const navLinkGroups = [
  {
    name: "Basic components",
    links: [
      {
        key: "<Overview>",
        name: "Overview",
        url: "/overview",
      },
    ],
  },
];

const NavigationBar = () => {
  return (
    <Nav
      groups={navLinkGroups}
      focusZoneProps={{
        defaultTabbableElement: "a[title='Breadcrumb']",
        allowFocusRoot: false,
      }}
    />
  );
};

export default NavigationBar;
